import { FROM, TO, DATE, GUESTS, CLASS } from "./actionTypes";

export const fromHandler = (val) => {
  return {
    type: FROM,
    payload: val,
  };
};

export const toHandler = (val) => {
  return {
    type: TO,
    payload: val,
  };
};

export const dateHandler = (val) => {
  return {
    type: DATE,
    payload: val,
  };
};

export const guestsHandler = (val) => {
  return {
    type: GUESTS,
    payload: val,
  };
};

export const classHandler = (val) => {
  return {
    type: CLASS,
    payload: val,
  };
};
